The Signal API clearly identifies errors when a request cannot be processed. Invalid Inputs If invalid parameters are passed, an error will be returned with a 403 response code. For example, if a transaction_id or call_start_time are not passed in the request, the following error will be returned. Response (403 Forbidden): { "errors": { "class": "InvalidInput", "invalid_data": "transaction_id, call_record_id, or call_start_time must not be empty" }
} If there are multiple issues with the request, we will do our best to package all of the issues together in one response message. Example Bad Request { "search": { "transaction_id": "0000000-0000000A" }, "signals": [ { "name": "sale", "custom_parameter_1": "12345" }, { "revenue": "1,000", "value": "true" }, { "name": "sale", "description": "duplicate" } ], "custom_data": [ { "value": "no_name" }, { "name": "no_value" } ], "oauth_token": "<YOUR OAUTH TOKEN>"
} Response (403 Forbidden): { "errors": { "class": "InvalidInput", "invalid_data": "The following params in 'signals' are not supported in this version: custom_parameter_1, description; signals[1] 'name' is required; 'name' for signals[0] and signals[2] must be unique; 'name' for custom_data[0] is required; 'value' for custom_data[1] is required" }
} Record Invalid Error In the case that we are not able to find all of the issues in the request before processing, we will package up any errors that occur during processing with the following error response: Response (403 Forbidden): { "errors": { "class": "RecordInvalid", "invalid_data": "Validation failed: Signals are limited to 100" }
} Record Not Found Error If no record is found for the search parameters that are passed in the request, an error will be returned with a 404 response code. For example, if a call cannot be found for the search parameters passed, the following error will be returned. Response (404 Not Found): { "errors": { "class": "RecordNotFound", "invalid_data": "No call found. Please refer to the documentation." }
} Permission Errors If you do not have access to the Signal API, the following error will be returned with a 403 response code. Response (403 Forbidden): { "errors": { "class": "UnauthorizedOperation", "invalid_data": "You do not have permissions to perform the requested operation." }
} Authorization Errors If you do not have access to the advertiser_id_from_network , advertiser_campaign_id_from_network , or the network_id an error will be returned with a 403 response code. For example, if you pass an advertiser_id_from_network that you do not have access to, the following error will be returned. Response (403 Forbidden): { "errors": { "class": "UnauthorizedAdvertiser", "invalid_data": "You do not have access to this advertiser" }
}

