Note : This specific section only applies if you have begun using the Signal Transactions Rollup feature. This will only apply to calls that occur after the date that this feature is enabled. If you are unsure about whether you are using this feature, please contact the Invoca Customer Successs team. All Signals and Custom Data within a single request will be grouped together based on the value of the field partner_unique_id . There will be a single transaction for each group created. These new transactions will have the transaction type Post Call Event . A maximum of 10 transactions can be applied for a single request. However, this limit does not apply to the number of Signals or Custom Data included in a single grouping. See the Best Practices section for understanding why this limit is enforced. Request Parameter changes: The existing fields partner_unique_id and occurred_at_time can now be specified at the top-level of a request following the same formatting described above. This will be applied to all signals and custom data in the request. These fields can still be specified inline with each signal, but signals with different values for partner_unique_id will be not be grouped together. If specified inline for a specific signal, it will take precedence for that signal over the top-level value. Custom Data fields will be grouped together into a Post Call Event transaction using the top-level partner_unique_id (this may be omitted and will default to the empty string). Using a single partner_unique_id at the top level, such that it will be used for all Signals and Custom Data, is highly recommended . This will minimize the number of transactions that show up in the Transaction Detail reports and the Transactions API. Response Parameter changes: The signals array will contain an entry for each Post Call Event Transaction created. Since Signals may be grouped, the name and value of each Post Call Event Transaction will be a comma-separated list corresponding to the signals grouped within. Custom Data fields will not be displayed here, but will be applied to the Post Call Event transaction corresponding the the top-level partner_unique_id Example Request { "search": { "transaction_id": "00000000-00000001" }, "partner_unique_id": "1", "occurred_at_time": "2019-02-14T13:30:04Z", "signals": [{ "name": "Quote", "revenue": "100.0" }, { "name": "Appointment Made", "value": "false" }], "custom_data": [{ "name": "line_of_business", "value": "Great Deals" }, { "name": "utm_source", "value": "google.com" }], "oauth_token": "<YOUR OAUTH TOKEN>"
} Example Response { "signals": [{ "transaction_id": "00000000-0000000A", "corrects_transaction_id": null, "name": "Quote,Appointment Made", "partner_unique_id": "1", "occurred_at_time_t": "1550179818", "occurred_at_time": "2019-02-14T13:30:04Z", "revenue": "100.0", "value": "true,false" }], "call": { "transaction_id": "00000000-00000001", "corrects_transaction_id": null, "start_time_t": "1435993200", "call_start_time": "2015-07-04T07:00:00Z" }
} Additional Errors We no longer support specifying revenue at the top level header of the request. Revenue must be specified on each Signal. { "errors": { "class": "RecordInvalid", "invalid_data": "Revenue must be specified on each Signal instead of at the top level header of the request" }
}

