Notice for users of the Signal Transactions Rollup feature: If you are using the Signal Transactions Rollup feature (see section Signal Transactions Rollup above), some of the Updates and Idempotency information below has changed slightly. Signals and Custom Data are considered unique by partner_unique_id only; name is not considered. Signals and Custom data are grouped into transactions according to partner_unique_id . If a request supplies the same partner_unique_id as a previous transaction, the previous transaction will be updated with the content of the new request. The information below regarding Updates and Idempotency still applies, but with this distinction. Signals: Signals are considered unique by a combination of name and partner_unique_id . For example, if you make two requests with the same name and partner_unique_id , the other params in the second request will update the original signal’s fields Therefore, if you make two requests with the same params, the signal will not be updated nor will a new one be made. It is safe then to re-post API requests without fear of duplicate data. If you change the partner_unique_id , a second signal of the same name will be associated with the transaction. Example of creating two signals (on a single call) then updating one HTTP POST parameters - first request (creates both signals, which are valid due to unique partner_unique_id ): { "search": { "transaction_id": "00000000-00000001" }, "signals": [{ "name": "Quote", "partner_unique_id": "1" }, { "name": "Quote", "partner_unique_id": "2" }], "oauth_token": "<YOUR OAUTH TOKEN>"
} Response (200 OK): { "signals": [{ "transaction_id": "00000000-0000000A", "corrects_transaction_id": null, "name": "Quote", "partner_unique_id": "1", "occurred_at_time_t": "1440607999", "occurred_at_time": "2015-08-26T16:53:19Z", "value": "true" }, { "transaction_id": "00000000-0000000B", "corrects_transaction_id": null, "name": "Quote", "partner_unique_id": "2", "occurred_at_time_t": "1440608000", "occurred_at_time": "2015-08-26T16:53:20Z", "value": "true" }], "call": { "transaction_id": "00000000-00000001", "corrects_transaction_id": null, "start_time_t": "1435993200", "call_start_time": "2015-07-04T07:00:00Z" }
} HTTP POST Parameters - second request (updates first request): { "search": { "transaction_id": "00000000-00000001" }, "signals": [{ "name": "Quote", "partner_unique_id": "1" }], "oauth_token": "<YOUR OAUTH TOKEN>"
} Response (200 OK): { "signals": [{ "transaction_id": "00000000-0000000C", "corrects_transaction_id": "00000000-0000000A", "name": "Quote", "partner_unique_id": "1", "occurred_at_time_t": "1440607999", "occurred_at_time": "2015-08-26T16:53:19Z", "value": "true" }], "call": { "transaction_id": "00000000-00000001", "corrects_transaction_id": null, "start_time_t": "1435993200", "call_start_time": "2015-07-04T07:00:00Z" }
} Note: even though this second request was an update to the first and will appear in reports as updating the first signal, a new signal transaction ID is returned. This is because a correction has been made to the first signal, and this new transaction ID is what will appear in webhooks and the Transactions API. Custom Data: Custom Data fields are considered unique by their name only. Each request made will apply a correction to the target call and override any existing Custom Data Field values for the provided fields. Therefore, subsequent requests will create corrections and appear as though the original call was updated. Note: Any signals provided or associated previously with the call with also reflect these new Custom Data values.
